import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial_page.png'));

    // 1. Add an item to the cart
    const addToCartButton = page.locator('.product-card .add-to-cart').first();
    await addToCartButton.click();

    // Wait for the "added to cart" notification to appear and disappear
    await page.waitForSelector('.notification.success.show');
    await page.waitForSelector('.notification.success:not(.show)');

    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_item_added.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_item_added.png'));

    // 2. Open the cart modal
    await page.locator('div.cart').click();
    await page.waitForSelector('#cartModal', { state: 'visible' });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_modal_open.png'));

    // 3. Extract initial quantity and total
    const initialQuantity = await page.locator('.cart-item-quantity .quantity').textContent();
    const initialTotal = await page.locator('#cartTotal').textContent();
    const initialCartHeaderCount = await page.locator('#cartCount').textContent();

    // 4. Increase the quantity of the item
    const increaseButton = page.locator('.cart-item-quantity .quantity-btn:has-text("+")');
    await increaseButton.click();

    // Wait for the quantity to update
    await page.waitForFunction(
      (expected) => document.querySelector('.cart-item-quantity .quantity')?.textContent.trim() === expected,
      String(parseInt(initialQuantity, 10) + 1)
    );

    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_quantity_updated.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_quantity_updated.png'));

    // 5. Extract final quantity and total to verify
    const finalQuantity = await page.locator('.cart-item-quantity .quantity').textContent();
    const finalTotal = await page.locator('#cartTotal').textContent();
    const finalCartHeaderCount = await page.locator('#cartCount').textContent();

    if (parseInt(finalQuantity, 10) <= parseInt(initialQuantity, 10)) {
        throw new Error('Quantity did not increase as expected.');
    }
     if (parseFloat(finalTotal) <= parseFloat(initialTotal)) {
        throw new Error('Total price did not increase as expected.');
    }

    return {
      success: true,
      action: "Updated cart item quantity by clicking the '+' button.",
      extractedData: {
        initialQuantity: initialQuantity.trim(),
        finalQuantity: finalQuantity.trim(),
        initialTotal: `$${initialTotal.trim()}`,
        finalTotal: `$${finalTotal.trim()}`,
        initialCartHeaderCount: initialCartHeaderCount.trim(),
        finalCartHeaderCount: finalCartHeaderCount.trim()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to update cart item quantity.",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
